50c696ee-47fe-4d9e-9730-b94cc766c59c.text:
k=int(input())
import math
from functools import reduce

def gcd(*numbers):
    return reduce(math.gcd, numbers)
ans=0
i=0

for a in range(1,k+1):
    for b in range(a+1,k+1):
        for c in range(b+1,k+1):
            ans+=gcd(a, b, c) * 6
            i+=6
for a in range(1,k+1):
    for b in range(a+1,k+1):#2,3
        ans+=gcd(a, b) * 6
        i+=6
for a in range(1,k+1):
    ans+=a
    i+=1
print(ans)

1832a0fe-de57-4e8e-b392-2a53e554d2f9.text:
N = int(input())
S = list(input())
R = []
G = []
B = []

cnt = 0

for i in range(N):
  if S[i] == "R":
    R.append(i)
  elif S[i] == "G":
    G.append(i)
  else:
    B.append(i)

B = set(B)
b = len(B)  

for i in R:
  for j in G:
    check = 0
    m = min(i, j)
    M = max(i, j)
    r = M - m
    left = m - r
    right = M + r
    if r % 2 == 0:
      center = m + r//2
      if center in B:
        check += 1
    if left in B:
      check += 1
    if right in B:
      check += 1
    cnt += b - check

print(cnt)
